import { useState } from "react";
import figureImg from "./../../images/avatar.png";


const [state, setState] = useState({});

const SignIn = () => {
    return ( 
    <div className="main__content">
        <figure className="figure__sign">
          <img src={figureImg} alt="userphoto" className="figure__img" />
        </figure>

        <form action="/" method="post" className="form">

         <label htmlFor="name" className="label__for__name"> <span>Username</span></label>
         <input type="text" id="name" name="user_name" placeholder="type Username" className="input__for__name" />

         <button type="submit" className="btn__sign__in">Sign-In</button>
        </form >
    </div>
    );
}

export default SignIn;
